INSERT INTO `sys_dict_type` (`dict_id`, `dict_name`, `dict_type`, `status`, `create_by`, `create_time`, `update_by`, `update_time`, `remark`) VALUES (12, '车辆类型', 'vehicletype', '0', 'admin', '2024-02-26 21:19:07', '', NULL, '轿车 / 小型车：通常是指乘用车，包括轿车、掀背车、两厢车等小型乘用车型。\nSUV / 大型车：运动型多用途车或大型乘用车，具有较大的车身尺寸和排量。\n客车 / 大型客车：用于运输乘客的大型客车，如长途客车、旅游巴士等。\n卡车 / 货车：用于货物运输的大型车辆，包括轻型、中型和重型卡车，以及载重卡车、自卸卡车等类型。\n摩托车：两轮或三轮摩托车，通常用于个人代步或快递配送。\n拖挂车 / 挂车：由载货车辆牵引的附属车辆，用于额外的货物运输或车辆运输。\n公交车：城市公共交通车辆，用于运输大量乘客。\n特种车辆：特定用途的车辆，如消防车、救护车、工程车等，通常具有特殊的行驶和停靠要求。');
